import './ascent.css';
import React from 'react';

import apis from '../../api';

class Ascent extends React.Component() {
    constructor(props) {
        super(props);
        this.state = {teams: null};
    }

    componentDidMount() {
        this.teams = apis.getTeamsByMap('Ascent');
        console.log(this.teams)
    }
    
    render() {
        return (
            <div>
                Ascent
            </div>
        )
    }
};
